import java.util.Arrays;
import java.util.HashSet;
import java.util.Set;
import java.util.TreeSet;

public class L_451 {
    public static void main(String[] args) {
        System.out.println(frequencySort("tree"));
        System.out.println(frequencySort("cccaaa"));
        System.out.println(frequencySort(""));
    }


    public static String frequencySort(String str) {
        byte[] bytes = new byte[str.length()];
        str.getBytes(0, str.length(), bytes, 0);
        int[] soni = new int['z' + 1];
        for (byte i : bytes) {
            soni[i]++;
        }
        TreeSet<Integer> a = new TreeSet<>();
        for (Integer i : soni) {
            a.add(i);
        }
        StringBuilder res = new StringBuilder();
        for (Integer i : a) {
            for (int j = 0; j < soni.length; j++) {
                if (i == soni[j]) {
                    for (int k = 1; k <= i; k++) {
                        res.insert(0, (char) j);
                    }
                }
            }
        }
        return res.toString();
    }

    private static String getTartibli(String str) {
        byte[] bytes = new byte[str.length()];
        str.getBytes(0, str.length(), bytes, 0);
        Arrays.sort(bytes);
        StringBuilder res = new StringBuilder();
        for (byte i : bytes) {
            res.append(i);
        }
        return res.toString();
    }
}
